// // ------------cách 2------------
import navBar from "../../data/navBar.json";
function NavBarAs1() {
  console.log(navBar);
  return (
    <div className="container-fluid bg-primary">
      <div className="row">
        <div className="col-md-8">Booking wbsite</div>
        <div className="col-md-4">
          <button>Register</button>
          <button>Login</button>
        </div>
      </div>
      <div className="row">
        <ul>
          <li>
            <a href="#">
              <i>Home</i>
            </a>
          </li>
          <li>Home</li>
          <li>Home</li>
        </ul>
      </div>
    </div>
  );
}
export default NavBarAs1;
